using System;
using UnityEditor;
using UnityEditorInternal;
using UnityEngine;

[CustomEditor(typeof(EventTrigger))]
public class EventTriggerEditor : Editor
{
    ReorderableList commandList;

    void OnEnable()
    {
        commandList = new ReorderableList(serializedObject,
                                          serializedObject.FindProperty("commands"),
                                          true, true, true, true);

        commandList.elementHeightCallback = (index) =>
        {
            var element = commandList.serializedProperty.GetArrayElementAtIndex(index);
            return GetElementHeight((CommandType)element.FindPropertyRelative("commandType").enumValueIndex);
        };

        commandList.drawElementCallback = (rect, index, isActive, isFocused) =>
        {
            var element = commandList.serializedProperty.GetArrayElementAtIndex(index);
            rect.y += 2;
            EditorGUI.PropertyField(new Rect(rect.x, rect.y, 60, EditorGUIUtility.singleLineHeight),
                element.FindPropertyRelative("commandType"), GUIContent.none);

            CommandType commandType = (CommandType)element.FindPropertyRelative("commandType").enumValueIndex;
            SerializedProperty commandArguments = element.FindPropertyRelative("commandArguments");

            switch (commandType)
            {
                case CommandType.Teleport:
                    if (commandArguments.arraySize < 1)
                    {
                        commandArguments.arraySize = 1;
                    }
                    EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                        commandArguments.GetArrayElementAtIndex(0), new GUIContent("Target"));
                    break;
                case CommandType.Write:
                    if (commandArguments.arraySize < 2)
                    {
                        commandArguments.arraySize = 2;
                    }
                    EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                        commandArguments.GetArrayElementAtIndex(0), new GUIContent("Write Speed"));
                    EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y + EditorGUIUtility.singleLineHeight, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                        commandArguments.GetArrayElementAtIndex(1), new GUIContent("Content"));
                    break;
                case CommandType.Move:
                    if (commandArguments.arraySize < 1)
                    {
                        commandArguments.arraySize = 1;
                    }
                    EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                        commandArguments.GetArrayElementAtIndex(0), new GUIContent("Target"));
                    break;
                case CommandType.SendEvent:
                    if (commandArguments.arraySize < 3)
                    {
                        commandArguments.arraySize = 3;
                    }
                    EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                        commandArguments.GetArrayElementAtIndex(0), new GUIContent("TargetID"));
                    EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y + EditorGUIUtility.singleLineHeight, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                        commandArguments.GetArrayElementAtIndex(1), new GUIContent("Start Delay"));

                    SerializedProperty nestedCommands = element.FindPropertyRelative("nestedCommands");

                    for (int j = 0; j < nestedCommands.arraySize; j++)
                    {
                        SerializedProperty nestedCommand = nestedCommands.GetArrayElementAtIndex(j);
                        SerializedProperty nestedCommandType = nestedCommand.FindPropertyRelative("commandType");
                        SerializedProperty nestedCommandArguments = nestedCommand.FindPropertyRelative("commandArguments");

                        rect.y += EditorGUIUtility.singleLineHeight * 2;
                        EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                            nestedCommandType, GUIContent.none);

                        CommandType nestedCommandTypeValue = (CommandType)nestedCommandType.enumValueIndex;

                        switch (nestedCommandTypeValue)
                        {
                            case CommandType.Teleport:
                                if (nestedCommandArguments.arraySize < 1)
                                {
                                    nestedCommandArguments.arraySize = 1;
                                }
                                EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y + EditorGUIUtility.singleLineHeight, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                                    nestedCommandArguments.GetArrayElementAtIndex(0), new GUIContent("Target"));
                                break;
                            case CommandType.Write:
                                if (nestedCommandArguments.arraySize < 2)
                                {
                                    nestedCommandArguments.arraySize = 2;
                                }
                                EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y + EditorGUIUtility.singleLineHeight, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                                    nestedCommandArguments.GetArrayElementAtIndex(0), new GUIContent("Write Speed"));
                                EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y + EditorGUIUtility.singleLineHeight * 2, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                                    nestedCommandArguments.GetArrayElementAtIndex(1), new GUIContent("Content"));
                                break;
                            case CommandType.Move:
                                if (nestedCommandArguments.arraySize < 1)
                                {
                                    nestedCommandArguments.arraySize = 1;
                                }
                                EditorGUI.PropertyField(new Rect(rect.x + 60, rect.y + EditorGUIUtility.singleLineHeight, rect.width - 60 - 30, EditorGUIUtility.singleLineHeight),
                                    nestedCommandArguments.GetArrayElementAtIndex(0), new GUIContent("Target"));
                                break;
                        }
                    }

                    if (GUI.Button(new Rect(rect.x + rect.width - 60, rect.y + EditorGUIUtility.singleLineHeight * (nestedCommands.arraySize + 2), 30, EditorGUIUtility.singleLineHeight), "+"))
                    {
                        nestedCommands.arraySize++;
                    }

                    if (nestedCommands.arraySize > 0 && GUI.Button(new Rect(rect.x + rect.width - 30, rect.y + EditorGUIUtility.singleLineHeight * (nestedCommands.arraySize + 2), 30, EditorGUIUtility.singleLineHeight), "-"))
                    {
                        nestedCommands.arraySize--;
                    }
                    break;
            }
        };
    }

    public override void OnInspectorGUI()
    {
        serializedObject.Update();
        commandList.DoLayoutList();
        serializedObject.ApplyModifiedProperties();
    }

    float GetElementHeight(CommandType commandType)
    {
        float height = 0;
        switch (commandType)
        {
            case CommandType.Teleport:
                height = 1;
                break;
            case CommandType.Write:
                height = 2;
                break;
            case CommandType.Move:
                height = 1;
                break;
            case CommandType.SendEvent:
                height = 6;
                break;
        }
        if (commandType == CommandType.SendEvent)
        {
            height += 1;
        }
        return height * EditorGUIUtility.singleLineHeight + 2;
    }

}

public class RelojDeArena {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char rpta = 's';
		int n;

		do {
			n = Helper.getPositiveInt("Ingrese una cantidad: ");

			for (int i = n; i >= 1; i--) {
				// Imprimir espacios
				for (int j = 0; j < n ; j++) {
					System.out.print(" ");
				}

				// Imprimir asteriscos
				for (int k = 1; k <= 2 * i ; k++) {
					System.out.print("*");

				}
				System.out.println(); // Cambiar de línea
			}

			// Imprimir pirámide en espejo
			for (int i = 2 ; i <= n; i++) {
				// Imprimir espacios
				for (int j = 0; j < n - i; j++) {
					System.out.print(" ");
				}

				// Imprimir asteriscos
				for (int k = 1; k <= 2 * i ; k++) {
					if (esPar(k)) {
						System.out.print("*");

					}else {
						System.out.print(" ");
					}
				}
				System.out.println();
			}
			rpta= Helper.getCharacter("Desea volver a ejecutar el programa?(s/n): ");
		}while(rpta!='n');
		System.out.println("Programa Terminado");
	}


	private static boolean esPar(int num) {
		if ((num%2)==0) return true;
		return false;
	}
}

import java.util.Scanner;

public class LeerNumerosPrimos {

	public static Scanner scanner = new Scanner(System.in);

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String contenido;	
		String aux = "";
		int numero;
		LeerArchivos documento = new LeerArchivos();
		System.out.println("Ingrese la dirección del archivo: ");
		String direccion = scanner.nextLine();
		System.out.println("Contenido del archivo: ");
		contenido = documento.leerArchivoDeTexto(direccion);
		System.out.println("Números primos dentro del archivo: ");
		
		for (char c: contenido.toCharArray()) {
			if(c != ' ') {
				aux+=c;
			}else {
				numero = Integer.parseInt(aux);
				if (esPrimo(numero)) {
					System.out.print(numero+" ");
				}
				aux="";
			}
		}
	}
	
	private static boolean esPrimo(int num) {
		int contador = 0;
		int i = 2;
		while(i<=(Math.sqrt(num))) {
			if (num%i==0)contador++;
			i++;
		}
		if (contador>0) return false;
		return true;
	}

}

import java.io.File;
import java.io.FileWriter;
import java.io.IOException;

public class EscribirArchivo {
	File archivo;
	private void crearArchivoDeTexto() {
	
		archivo = new File("archivo.txt");
	}
	
	private void escribirArchivo(String numeros) {
		try {
			FileWriter escritura = new FileWriter(archivo);
			escritura.write(numeros, 0, numeros.length());
			escritura.close();
			
			System.out.println("Archivo escrito con éxito");
		}catch(IOException e) {
			e.printStackTrace(System.out);
		}
	}
	
	private static String generarNumeros() {
		String numeros = "";
		int aux;
		
		for(int i = 1; i<5000;i++) {
			aux = Helper.random.nextInt(1,9999);
			numeros += aux+" ";
		}
		return numeros;
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		EscribirArchivo archivo = new EscribirArchivo();
		String contenido = generarNumeros();
		
		archivo.crearArchivoDeTexto();
		archivo.escribirArchivo(contenido);
	}

}

public class CaballoAjedrez {

	private int X;
	private int Y;
	private int[] movimientosFilas = {2, 1, -1, -2, -2, -1, 1, 2};
	private int[] movimientosColumnas = {1, 2, 2, 1, -1, -2, -2, -1};
	
	public CaballoAjedrez(int X, int Y) {
		this.X = X;
		this.Y = Y;
	}

	public void mover(char[][] tablero) {
		int i = Helper.random.nextInt(8);
		int nuevaFila = X + movimientosFilas[i];
        int nuevaColumna = Y + movimientosColumnas[i];
        
		while (!esMovValido(nuevaFila,nuevaColumna)) {
			i = Helper.random.nextInt(8);
			nuevaFila = X + movimientosFilas[i];
			nuevaColumna = Y + movimientosColumnas[i];
		}
		
		this.X = nuevaFila;
		this.Y = nuevaColumna;
	}
	
	public void mostrarTablero(char[][] tablero) {
		tablero[X][Y]='H';
		
		for(int i =0; i<8;i++) {
			int nuevaFila = X + movimientosFilas[i];
            int nuevaColumna = Y + movimientosColumnas[i];
			if (esMovValido(nuevaFila,nuevaColumna)) {
				tablero[nuevaFila][nuevaColumna]= '+';
			}
		}
		for(int i =0; i<tablero.length;i++) {
			for (int j = 0; j < tablero[i].length; j++) {
                System.out.print(tablero[i][j] + " ");
            }
            System.out.println();
		}
		System.out.println();
		this.limpiarTablero(tablero);
	}
	
	private boolean esMovValido(int fila, int columna) {
		return (fila >= 0 && fila < 10 && columna >= 0 && columna < 10);
	}
	
	private void limpiarTablero(char[][] tablero) {
		
		for (int i = 0; i < 10; i++) {
            for (int j = 0; j < 10; j++) {
                tablero[i][j] = '-'; 
            }
        }
	}
}

public class Ajedrez {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int X, Y;
		
		char[][] tablero = generarTablero(10,10);
		System.out.println("Simularemos movimientos de un caballo de ajerdrez");
		System.out.println("A continuación debe ingresar las coordenadas iniciales");

		X = Helper.getPositiveInt("Ingrese fila: ");
		while(X<0|X>9){
			System.out.println("Debe estar entre 0 y 9");
			X = Helper.getPositiveInt("Ingrese fila: ");
		}
		Y = Helper.getPositiveInt("Ingrese columna: ");
		while(Y<0|Y>9){
			System.out.println("Debe estar entre 0 y 9");
			Y = Helper.getPositiveInt("Ingrese columna: ");
		}

		CaballoAjedrez horse = new CaballoAjedrez(X,Y);
		for (int i = 0; i<5; i++ ) {
			horse.mostrarTablero(tablero);
			horse.mover(tablero);
		}
	}

	private static char[][] generarTablero(int filas, int columnas) {
        char[][] tablero = new char[filas][columnas];
        for (int i = 0; i < filas; i++) {
            for (int j = 0; j < columnas; j++) {
                tablero[i][j] = '-'; // Inicializar todo el tablero con espacios en blanco
            }
        }
        return tablero;
    }
	
	
}

import java.util.Random;

public class Tabla {
    private static Random rndm = new Random();


	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int[][] tabla = new int[7][7];
		int aux;
		
		for (int i=0; i <7;i++) {
			for (int j=0; j<7;j++) {
				if(i==j) {
					tabla[i][j] = 1;
				}else {
					aux = rndm.nextInt(99);
					while(esPar(aux)) {
						aux = rndm.nextInt(99);
					}
					tabla[i][j] = aux;
				}
				System.out.print(" ");
				System.out.print(tabla[i][j]);
				System.out.print(" ");
			}
			System.out.println();
		}
		
	}

	public static boolean esPar(int num) {
		if ((num%2)==0) return true;
		return false;
	}
}

#include <bits/stdc++.h>
#define fi first
#define se second
#define pb push_back
#define all(x) x.begin(),x.end()
#define rall(x) x.rbegin(),x.rend()
using namespace std;
using ii = pair<int, int>;
using i64 = long long;
const int INF = 0x3f3f3f3f;
const i64 INFLL = 0x3f3f3f3f3f3f3f3f;

int main() {
  cin.tie(0)->sync_with_stdio(0);

  int l, s; cin >> l >> s;
  if (l == s and l == 1) {
    cout << "2 1\n1 2\n";
    return 0;
  }

  if (2*s < l or s > l) {  
    cout << "-1\n";
    return 0;
  }

  if (s + 1 == l) {
    if (l == 2) {
      cout << "4 4\n";
      cout << "1 2\n";
      cout << "2 3\n";
      cout << "2 4\n";
      cout << "3 4\n";
      return 0;
    }
    int qtdCycle = 2 * l - 2;

    cout << 1 + qtdCycle << ' ' << 1 + qtdCycle << '\n';
    for (int u = 1; u <= qtdCycle; ++u) {
      if (u == qtdCycle) {
        cout << qtdCycle << ' ' << "1\n";
        continue;
      }
      cout << u << ' ' << u+1 << '\n';
    }
    cout << qtdCycle+1 << ' ' << "1\n";

    return 0;
  }

  if (s == (l+1)/2) {
    cout << l+1 << ' ' << l << '\n';
    for (int i = 0; i < l; ++i) {
      cout << i+1 << ' ' << i+2 << '\n';
    }
  } else if (s == l) {
    int qtdCycle = 2 * l;
 
    cout << qtdCycle << ' ' << qtdCycle << '\n';
    for (int u = 1; u <= qtdCycle; ++u) {
      if (u == qtdCycle) {
        cout << qtdCycle << ' ' << "1\n";
        continue;
      }
      cout << u << ' ' << u+1 << '\n';
    }
  } else {
    int qtdNodes = 2 * s + 2 * (l - s) - 1;

    vector<ii> edges;
    for (int u = 1; u <= 2 * s; ++u) {
      if (u == 2*s) {
        edges.push_back({u, 1});
      } else {
        edges.push_back({u, u+1});
      }
    }

    int delta = 2 * s;
    if (s != l) {
      edges.push_back({1, delta+1});
    }
    for (int u = 1; u < 2*(l-s); ++u) {
      if (u == 2*(l-s)-1) {
        // cout << delta+u << ' ' << "1\n";
        edges.push_back({delta+u, 1});
      } else {
        // cout << delta+u << ' ' << delta+u+1 << '\n';
        edges.push_back({delta+u, delta+u+1});
      }
    }

    cout << qtdNodes << ' ' << edges.size() << '\n';
    for (auto [a, b] : edges) {
      cout << a << ' ' << b << '\n';
    }
  }
}

