from flask import Flask, jsonify, request

app = Flask(__name__)

"""
alumnos = [
	 {"id":1, "nombre":"Juan", "cursos":4};
	 {"id":2, "nombre":"Ana", "cursos":1};
]

"""
alumnos = []

# creo el codigo HTML del formulario
formulario_html = """
<!DOCTYPE html>
<body>
	<form method="POST">
	Nombre:<br><input type="text" name="nombre"><br>
	Cursos:<br><input type="number" name="cursos"><br>
	<br><br>
	<input type="submit" value="Enviar">
	</form>
</body>
</html>
"""
def salida_html(mensaje):
	return f"""
	<html>
		<head>
			<meta http-equiv="refresh" content="3"; URL="http://localhost:5000/form">
		</head>
		<body>{mensaje}</body>
	</html>
	"""







@app.route("/")
def home():
	return "<em>Hola</em> a <strong>todos</strong>"
	
@app.route("/admin")
def admin():
	return "<h2>En construcción...</h2>"
	
	
@app.route("/alumnos", methods=['GET','POST','PUT','DELETE'])
def get_alumnos():
	
	if request.method == "GET":
		return jsonify({"alumnos":alumnos})
	
		
	elif request.method == "POST":
		if not alumnos:
			id_alumno = 1
		else:
			id_alumno = alumnos[-1]['id'] + 1
		
		alumno = {
			'id':id_alumno,
			'nombre': request.json['nombre'],
			'cursos': request.json['cursos']
		}
		alumnos.append(alumno)
		return jsonify("Alumno añadido")
		
	
	elif request.method == "PUT":
		id_alumno = request.json['id']
		for alumno in alumnos:
			if id_alumno ==  alumno.get('id'):
				if request.json['nombre'] is not None:
					alumno['nombre'] = request.json['nombre']
				if request.json['cursos'] is not None:
					alumno['cursos'] = request.json['cursos']
				return jsonify("Datos modificados")
		return jsonify(f"Alumno con id={id_alumno} no encontrado")
		
		
	elif request.method == "DELETE":
		id_alumno = request.json['id']
		for alumno in alumnos:
			if id_alumno ==  alumno.get('id'):
				alumnos.remove(alumno)
				return jsonify("Alumno borrado")
		return jsonify(f"Alumno con id={id_alumno} no encontrado")
				
	
@app.route('/alumnos/<int:i>')
def ver_alumno(i):
	try:
		return jsonify({"alumno":alumnos[i-1]})
	except IndexError:
		return jsonify(f"Alumno id={i} no hallado")


@app.route('/form', methods=["GET","POST"])
def formulario():
	if request.method == "GET":
		return formulario_html.encode('utf-8')
	
	elif request.method == "POST":
		try:
			ctx = dict(request.form)
		except Exception:
			pass
		else:
			if ctx['nombre'] and ctx['cursos']:
				if not alumnos:
					id_alumno = 1
				else:
					id_alumno = alumnos[-1]['id'] + 1
				print(f"""
				Datos del alumno añadido:
				-------------------------
				ID: {id_alumno}
				Nombre: {ctx['nombre']}
				Cursos; {ctx['cursos']}
				-------------------------
				""")

				# guardo los datos
				alumno = {
					"id": id_alumno,
					"nombre": ctx['nombre'],
					"cursos": ctx['cursos']
				}
				alumnos.append(alumno)
				
				mensaje = "Datos almacenados correctamente"
			else:
				mensaje ="Datos incompletos"
		
		return salida_html(mensaje).encode('utf-8')
	return salida_html("ERROR: solo se aceptan requests GET o POST").encode('utf-8')	
	
	
	
if __name__ == "__main__":
	app.run(debug=True)
	
