#!/usr/bin/env python
# -*- coding: utf-8 -*-
#

import requests
from pprint import pprint

url = "http://localhost:5000/alumnos"


def mostrar_respuesta(r):
	return f"""
	Server response code: {r.status_code}
	Server response: {r.json()}
	""" 

def menu():
	return f"""
	Administración del sistema
	--------------------------
	1. Agregar un alumno
	2. Modificar nombre
	3. Modificar cursos
	4. Listar alumnos
	5. Eliminar un alumno
	6. Salir
	--------------------------
	"""


while True:
	print(menu())
	opcion = input("Seleccione una opción: ")
	
	if opcion == "1":
		nombre = input("Nombre: ")
		cursos = int(input("Cursos: "))
		ctx = {"nombre": nombre, "cursos":cursos}
		r = requests.post(url, json=ctx)
		print(mostrar_respuesta(r))
		
		
		
	elif opcion == "2":
		id_alumno = int(input("ID del alumno: "))
		nombre = input("Nuevo nombre: ")
		ctx = {"id":id_alumno, "nombre": nombre, "cursos":None}
		r = requests.put(url, json=ctx)
		print(mostrar_respuesta(r))
		
				
		
	elif opcion == "3":
		id_alumno = int(input("ID del alumno: "))
		cursos = input("Nueva cantidad de cursos: ")
		ctx = {"id":id_alumno, "nombre": None, "cursos":cursos}
		r = requests.put(url, json=ctx)
		print(mostrar_respuesta(r))
		
				
		
	elif opcion == "4":
		r = requests.get(url)
		if r.status_code == 200:
			alumnos = r.json()['alumnos']
			if alumnos:
				pprint(alumnos)
			else:
				print("No hay alumnos inscriptos")
		else:
			print("No se pudo imprimir la lista de alumnos")
			print(mostrar_respuesta(r))		
		
		
		
	elif opcion == "5":
		id_alumno = int(input("ID del alumno: "))
		ctx = {"id": id_alumno}
		r = requests.delete(url, json=ctx)
		print(mostrar_respuesta(r))
		
		
	elif opcion == "6":
		print("Cerrando conexión con el servidor...")
		break
		
	else:
		print("Opción incorrecta")

