class MinStack {

private:

struct Pair {

    int Val;
    int Min;

};

stack<Pair, list<Pair>> Stack;

public:
    MinStack() {}
    
    void push(int val) {
        
        if(Stack.empty()){
            Stack.emplace(val,val);
        }else{
            Stack.emplace(val,min(val, getMin()));
        }

    }
    
    // "Methods pop, top and getMin operations will always be called on non-empty stacks."
    void pop() {
        Stack.pop();
    }
    
    int top() const {
        return Stack.top().Val;
    }
    
    int getMin() const {
        return Stack.top().Min;
    }
};

