class MinStack {

    struct Item {

        int value;

        int min;
    };

    stack<Item, list<Item>> st;
public:
    void push(int x) {
        if (st.empty()) {
                st.push(Item{ x, x });
        }
        else {
            st.push(Item{ x, min(x, st.top().min) });
        }
    }

    void pop() {
        if (st.empty()) {
            throw logic_error("pop from empty stack");
        }
        st.pop();
    }

    int top() const {
        if (st.empty()) {
            throw logic_error("top when stack empty");
        }
          return st.top().value;
    } 

    int getMin() const {
        if (st.empty()) {
            throw logic_error("getMin when stack empty");
        }
        return st.top().min;
    }
};



