void test_maxs() {
	const int size = 100;
	int arr[size];
	generate_arr(size, arr);

	int max = arr[0];
	int id_maxs[size];
	int num_max = 0;

	for (int k = 1; k < size; k++)
		max = (max < arr[k]) ? arr[k] : max;

	for (int k = 0; k < size; k++) {
		if (arr[k] == max) {
			id_maxs[num_max] = k;
			num_max++;
		}
	}

	show_arr(size, arr);
	cout << max << endl;
	show_arr(num_max, id_maxs);
}

